#2536. Increment Sub matrices by One

class Solution(object):
    def rangeAddQueries(self, n, queries):
        """
        :type n: int
        :type queries: List[List[int]]
        :rtype: List[List[int]]
        """
        m = [[0 for y in range(n)] for x in range(n)]
        for q in queries:
            r1, c1, r2, c2 = q
            for r in range(r1, r2+1):
                m[r][c1] += 1
                if c2+1 < n:
                    m[r][c2+1] -= 1
        for r in range(n):
            for c in range(1, n):
                m[r][c] += m[r][c-1]
        return m


